using BookingPlatform.Application.Common.Interfaces;
using BookingPlatform.Domain.Entities;
using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using System.Text;
using System.Threading.Tasks;

namespace BookingPlatform.Infrastructure.Persistence
{
    public class ApplicationDbContext : DbContext, IApplicationDbContext
    {
        private readonly IDateTime _dateTime;

        public ApplicationDbContext(DbContextOptions<ApplicationDbContext> options) : base(options)
        {
        }

        public DbSet<Room> Rooms { get; set; }

        public DbSet<Booking> Bookings { get; set; }

        public DbSet<RoomImage> RoomImages { get; set; }

        public override Task<int> SaveChangesAsync(CancellationToken cancellationToken = new CancellationToken())
        {
            return base.SaveChangesAsync(cancellationToken);
        }

        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {
            modelBuilder.ApplyConfigurationsFromAssembly(Assembly.GetExecutingAssembly());

            base.OnModelCreating(modelBuilder);

            modelBuilder.Entity<Room>().HasData(
                new Room
                {
                    Id = 1,
                    Description = "Double Room",
                    Capacity = 2,
                    Address = "4 Florence, Taguig, Metro Manila Philippines",
                    IsPetFriendly = true,
                    PricePerNight = 2000,
                    Title = "Cozy Studio Room For Rent"
                });

            var imageBase64_1 = "";
            modelBuilder.Entity<RoomImage>().HasData(
                new RoomImage
                {
                    Id = 1,
                    RoomId = 1,
                    Image = Convert.FromBase64String(imageBase64_1)
                });

            var imageBase64_2 = "";
            modelBuilder.Entity<RoomImage>().HasData(
                new RoomImage
                {
                    Id = 2,
                    RoomId = 1,
                    Image = Convert.FromBase64String(imageBase64_2)
                });
        }
    }
}
